import React from 'react';
import "./Login.css";

const Login = () => {
    return (
        <div className="main-container custom-height">

            <div className="login-screen w-full max-w-6x1 flex items-start">

                <div className="div-azul">
                    <h1 className="title text-white">Assistente <br/> Virtual</h1>
                    <p className="text-white text-center">
        Título: DESCUBRA AQUI! A Jô, nossa assistente virtual, tem um jeitinho todo especial de se expressar: ela adora interagir com emojis! Ao simplificar buscas e fornecer informações sobre a fundação, a Jô também se torna além de eficientes, mas também divertida e amigável para você.
    </p>
                </div>


                <div className="div-branca">
                    <h1 className="text-black">Div Branca</h1>
                </div>
            </div>
        </div>
        
    );
};



export default Login;
